import { useState } from "react";
import Banner from "../../components/player/Banner";

const [isCategori,setIsCategori] = useState('전체');
const categoriList = ['전체','골키퍼','수비수','미드필더','공격수','군입대','입대','우선지명'];


export default function Pro () {
    return(
        <>
          <Banner onBannerTab={'프로'} aniWidth={'50%'}/>
          <section className="size1442 proArea">
            <div>
                {categoriList.map((el,index) => <button className={isCategori === el ? 'actice' : ''} onClick={() => setIsCategori(el)} key={index}>{el}</button>)}
            </div>
          </section>
        </>

    )
}
